const Grid = ({ number }) => {
  console.log();
  return (
    <>
      <div className="grid">
        {[...Array(number)].map((_, i) => (
          <div key={i} className="grid-item">
            <div className="grid-box"></div>
            <div className="info"></div>
          </div>
        ))}
      </div>
      <style jsx>
        {`
          .grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(25rem, 1fr));
            grid-gap: 2rem;
            padding: 0 2rem;
          }

          .grid-box {
            height: 200px;
            background-color: #eee;
          }
        `}
      </style>
    </>
  );
};

export { Grid };
